function ongoingApplicationsSetup(res) {
    $.each(res, function (index, data) {
        if (data.gender === 'female') {
            data.gender = 'Kvinne';
        } else {
            data.gender = 'Mann';
        }

        data.amount = data.amount.toString();
        data.amount = data.amount.replace(/\B(?=(\d{3})+(?!\d))/g, ' ');

        var $application = $('<div class="an-application"></div>').append(
            $('<div class="applicant-attr text-center strong"><span>' + data.gender + ', </span><span class="applicant-gender">' + data.age + '&nbsp;r</span></div>'),
            $('<div class="applicant-stats"><p class="strong">SKNAD: <span><span>(' + data.repaymentTime + ' mn)</span><span>' + data.amount + '&nbsp;kr&nbsp;</span></span></p><p class="strong">HYEST RENTE: <span class="red-dot"></span><span>' + data.worstEffectiveInterest.toFixed(2) + '%</span><p class="strong">LAVESTE RENTE: <span class="green-dot"></span><span>' + data.bestEffectiveInterest.toFixed(2) + '%</span><p class="strong">AT SPARE: <span>' + data.savePerYear + '&nbsp;kr/r</span></div>')
            );
        $('.ongoing-applications-wrap').append($application);
    });

    applicationSlide = new Siema({
        selector: '.ongoing-applications-wrap',
        loop: true,
        perPage: {
            658: 2,
            992: 3,
            1247: 4,
            1535: 5
        },
    });
    Siema.prototype.addPagination = function () {
        for (var i = 0; i < this.innerElements.length; i++) {
        }
        i = i / 4;
        for (var j = 0; j < i; j++) {
            $('.ongoing-applications-outer .dots').append('<span></span>');
        }
        $('.ongoing-applications-outer .dots span').first().addClass('active');
    };
    applicationSlide.addPagination();

    $('.application-scroll-right').click(applicationNext);
    $('.application-scroll-left').click(applicationPrev);
}

